#include <bits/stdc++.h>
using namespace std;

class Solution
{
public:
    int minimumSwitchingTimes(vector<vector<int>> &source, vector<vector<int>> &target)
    {
        list<int> s, t;
        int n = source.size();
        int m = source[0].size();
        int counter = 0;
        bool stop = false;
        for (size_t i = 0; i < n; ++i)
        {
            for (size_t j = 0; j < m; ++j)
            {
                insert(s, source[i][j], i * n + j);
                insert(t, target[i][j], i * n + j);
            }
        }
        auto is = s.begin();
        auto it = t.begin();
        while (is != s.end() && it != t.end())
        {
            if (*it > *is)
            {
                ++counter;
                ++it;
            }
            else if (*is > *it)
            {
                ++is;
            }
            else
            {
                ++it;
                ++is;
            }
        }
        while (it != t.end())
        {
            ++it;
            ++counter;
        }
        return counter;
    }

private:
    void insert(list<int> &s, int val, size_t end)
    {
        for (auto i = s.begin(); i != s.end(); ++i)
        {
            if (val > *i)
            {
                s.insert(i, val);
                return;
            }
        }
        s.push_back(val);
    }
};

